import React from 'react';
import "./fetch.css";

function fetchZips(props){
    return(
        <div>
            <form>
                <h1 className = "fetching">Enter ZipCode: </h1>
                <p id = "nonValid"></p>
                <input className = "fetching" id = "zipCode" name = "zipCode" type = "text" placeholder = "i.e.: 00000" onChange = {props.handleZipChange}></input>
            </form><br></br><br></br>
        </div>
    )
}

export default FetchZips;
